@BarristersHorse @JamesInnes99 Ukraine now have NATO trained highly motivated troops fighting to recover their territory.
Russia are fielding reservists, who don’t want to go, demoralised, very poor training, fighting in a country they don’t want to go to.
Which makes it a zero sum game for Putin.

@washingtonpost Its not retreat.
They done their job of teaching Ukraine a lesson.
Now going home.

